import React from "react";

const FetchWatchReports = ({ item }) => {
  return (
    <div className="card">
      <li>IR:{item.id}  |  Name: {item.name}  | Address street: {item.address.street}, city: {item.address.city}</li>
      <li>lat:{item.name}</li>
    </div>
  );
};

export default FetchWatchReports;
